import React from "react";
import Navbar from "../components/Navbar";
import Footer from "../components/Footer";

import "./routesCss/Home.css";

const Home = () => {
	return (
		<>
			<div className="homeContainer">
				<Navbar />

				<Footer />
			</div>
		</>
	);
};

export default Home;
